import React from "react"

const Country = ({ name }) => {
    const handler = () => {
        console.log('handling: ' + name)
    }
    return (
        <div onClick={handler} style={{
            fontSize: '16px',
            padding: '8px',
            border: '2px solid black',
            margin: '12px'
        }}>{name}</div>
    )
}

export default Country
